css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #000000;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #d5d8d6;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #d5d8d6;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #d5d8d6;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #a6a8a6;
  box-sizing: border-box;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #ffffff;
  color: #808080;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f1fec3;
  color: #808080;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #808080;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #a6a8a6;
}
atom-text-editor .invisible,
:host .invisible {
  color: #000000;
}
atom-text-editor .cursor,
:host .cursor {
  color: #000000;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #f1fec3;
  border: 1px solid #d5d8d6;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #a6a8a6;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #a6a8a6;
}
.comment {
  color: #a6a8a6;
}
.entity.name.type {
  color: #3a57b8;
}
.entity.other.inherited-class {
  color: #3a57b8;
}
.keyword {
  color: #ff7700;
}
.keyword.control {
  color: #ff7700;
}
.keyword.operator {
  color: #ff7700;
}
.keyword.other.special-method {
  color: #3a57b8;
}
.keyword.other.unit {
  color: #ff7700;
}
.storage {
  color: #ff7700;
}
.constant {
  color: #3a57b8;
}
.constant.character.escape {
  color: #3c9d06;
}
.constant.numeric {
  color: #cc6666;
}
.constant.other.color {
  color: #3c9d06;
}
.constant.other.symbol {
  color: #3c9d06;
}
.variable {
  color: #000000;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #000000;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #ffffff;
}
.string {
  color: #3c9d06;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #ff7700;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #a6a8a6;
}
.punctuation.definition.string {
  color: #3c9d06;
}
.punctuation.definition.parameters,
.punctuation.definition.variable,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #3a57b8;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #3a57b8;
}
.support.function {
  color: #3a57b8;
}
.support.function.any-method {
  color: #000000;
}
.entity.name.function {
  color: #3a57b8;
}
.entity.name.class,
.entity.name.type.class {
  color: #3a57b8;
}
.entity.name.section {
  color: #3a57b8;
}
.entity.name.tag {
  color: #3a57b8;
}
.entity.other.attribute-name {
  color: #3a57b8;
}
.entity.other.attribute-name.id {
  color: #3a57b8;
}
.meta.class {
  color: #3a57b8;
}
.meta.link {
  color: #ff7700;
}
.meta.require {
  color: #3a57b8;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #000000;
}
.none {
  color: #000000;
}
.markup.bold {
  color: #ff7700;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #3a57b8;
}
.markup.inserted {
  color: #3c9d06;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #ff7700;
}
.markup.raw.inline {
  color: #3c9d06;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #3c9d06;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json {
  color: #3a57b8;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json > .punctuation.string {
  color: #3a57b8;
}
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json,
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json > .punctuation,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json > .punctuation {
  color: #3c9d06;
}
.source.json .meta.structure.dictionary.json > .constant.language.json,
.source.json .meta.structure.array.json > .constant.language.json {
  color: #cc6666;
}
.source.php .entity.other.attribute-name {
  color: #3a57b8;
}
.source.php .entity.other.inherited-class {
  color: #3a57b8;
}
.source.php .support.function {
  color: #3a57b8;
}
.source.php .support.function.builtin {
  color: #3a57b8;
}
.source.php .support.type {
  color: #f1fec3;
}
.source.php .support.constant {
  color: #3a57b8;
}
.source.php .support.class,
.source.php .support.variable,
.source.php .support.other.module {
  color: #3a57b8;
}
